(2, '/images/news/euros1.jpg', 'یورو', 'یورو 20  شد.', '<div><font face=\"Tahoma\">🔹 قیمت طلا در معاملات روز پنج‌شنبه تحت تاثیر نگرانی‌ها نسبت به کندی رشد اقتصاد جهانی و نوسان بازارهای سهام که تقاضا برای سرمایه‌گذاری مطمئن را تقویت کرد، به بالاترین حد در بیش از شش ماه گذشته صعود کرد.</font></div><div><font face=\"Tahoma\"><br></font></div><div><font face=\"Tahoma\">🔹 هر اونس طلا برای تحویل فوری در معاملات روز جاری بازار سنگاپور با ۰.۳ درصد افزایش، به ۱۲۸۸.۴۳ دلار رسید که بالاترین قیمت از زمان ثبت رکورد ۱۲۹۰.۰۹ دلار در ۱۵ ژوئن ۲۰۱۸ بود.</font></div>', 2, 1, '2019-01-03 14:08:52', '2019-01-06 20:46:34'),
(3, '/images/news/489234036455551.jpg', 'نرخ دلار تا پایان سال', 'آیا نرخ دلار تا پایان سال ثابت می ماند؟', '<p style=\"padding: 0px; color: rgb(34, 34, 34); font-family: yekan;\">به گزارش ایسنا، با توجه به ثبات نسبی شکل گرفته در بازار ارز، این تصور که این بازار در ماه‌های منتهی به پایان سال با شوک قیمتی خاصی رو به رو می‌شود، سخت است و پیش‌بینی می‌شود ثبات نسبی اخیر فعلا حفظ شود.</p><p style=\"padding: 0px; color: rgb(34, 34, 34); font-family: yekan;\">در این باره محمدرضا انصاری -<strong style=\"margin: 0px; padding: 0px;\">&nbsp;نایب رییس اتاق بازرگانی ایران - پیش‌بینی کرد که ثبات نسبی نرخ ارز همچنان ادامه خواهد داشت</strong>&nbsp;و با توجه به مدیریت صورت گرفته می‌توان انتظار داشت که روال کار به همین ترتیب ادامه پیدا کند و در دل این ثبات نسبی، فعالان اقتصادی بتوانند برای آینده کاری خود برنامه‌ریزی کنند.</p><p style=\"padding: 0px; color: rgb(34, 34, 34); font-family: yekan;\">به اعتقاد کارشناسان، دولت فعلا و در طول ماه‌های گذشته به خوبی توانسته تقاضا برای ارز را کنترل کند و این امر خود را در ایجاد ثبات نسبی در بازار نشان داده است. اگر همین روال حفظ شود&nbsp;و ظرفیت صادراتی نیز به طور کامل مورد استفاده قرار گیرد، می‌توان انتظار داشت که لااقل برای بخشی از فشارهای اقتصادی ایجاد شده در ماه‌های اخیر راه حل‌هایی پیدا شود.</p>', 1, 1, '2019-01-06 20:46:11', '2019-01-06 20:46:11'),
(4, '/images/news/پپ.jpg', 'حذف چهار صفر از پول ملی', 'حذف چهار صفر از پول ملی جدی شد.', '<p style=\"padding: 0px; color: rgb(34, 34, 34); font-family: yekan;\">&nbsp;رییس کل بانک مرکزی ضمن اعلام این‌که لایحه حذف چهار صفر از پول ملی به دولت ارائه شده است، گفت: بانک مرکزی بر بازار ارز مسلط است و پیش‌بینی می‌شود عرضه ارز صادراتی شتاب بیشتری بگیرد. همچنین شاهد کنترل بیشتر تورم خواهیم بود.</p><p style=\"padding: 0px; color: rgb(34, 34, 34); font-family: yekan;\">به گفته همتی لایحه حذف چهار صفر از پول ملی روز گذشته از سوی بانک مرکزی تقدیم دولت شده است و این امیدواری وجود دارد که هرچه سریع‌تر این مهم به نتیجه برسد.</p>', 1, 1, '2019-01-06 20:48:51', '2019-01-06 20:48:51'),
(5, 'images/news/n82648295-71837687.jpg', 'هر اونس طلا چند گرم است؟', 'اونس یکی از واحدهای جرم است. نماد آن Oz که سرواژه عبارت Ounce است.', '<p dir=\"rtl\"><font face=\"IranSans\"><span style=\"font-size: 13px; text-align: right;\">&nbsp;اونس یکی از واحدهای جرم است. نماد آن Oz که سرواژه عبارت Ounce است.</span><br style=\"font-size: 13px; text-align: right;\"><span style=\"font-size: 13px; text-align: right;\">اونس معمولی در سیستم بین‌المللی اوزان، برابر با یک‌شانزدهم پوند یا ۴۰۰ ارزن است که در سیستم متریک مساوی ۲۸٫۳۴۹۵۲۳۱۲۵ گرم می‌شود.</span><br style=\"font-size: 13px; text-align: right;\"><span style=\"font-size: 13px; text-align: right;\">هم‌چنین برای اندازه‌گیری وزن فلزات گران‌بها یعنی؛ طلا، نقره، پلاتین و پالادیم از اونس بین‌المللی تروا استفاده می‌شود. که معادل ۳۱٫۱۰۳۴۷۶۸ گرم است. این اونس فقط برای اندازه‌گیری این فلزات گران‌بها کاربرد دارد و وزن شمش‌ها و سکه‌های طلا و دیگر فلزات گران‌بها و همین‌طور قیمت آن‌ها معمولاً با اونس تروا بیان می‌شود.</span><br style=\"font-size: 13px; text-align: right;\"><span style=\"font-size: 13px; text-align: right;\">اصطلاح یک اونس طلا به معنی طلایی یک‌تکه یا ساچمه با وزن یک اونس تروا و با خلوص ۹۹٫۹۹ درصد (۲۴ عیار) است.</span><br style=\"font-size: 13px; text-align: right;\"><span style=\"font-size: 13px; text-align: right;\">انواع دیگر اونس شامل اونس ماریا ترزا معادل ۲۸٫۰۶۶۸ گرم، اونس اسپانیایی معادل ۲۸٫۷۵ گرم، اونس متریک چینی معادل ۵۰ گرم و اونس متریک هلندی معادل ۱۰۰ گرم، می‌شوند.</span></font></p><p dir=\"rtl\"><font face=\"IranSans\"><span style=\"font-size: 13px; text-align: right;\">منبع : تی نیوز<br></span></font><br></p>', 1, 1, '2019-03-03 18:55:45', '2019-03-04 14:01:02'),
(6, 'images/news/23856864.jpg', 'بهترین راه برای خرید جواهرات', 'بهترین راه برای خرید جواهرات و سنگ های قیمتی مثل : الماس، زمرد و ....', '<h3 itemprop=\"articleBody\" style=\"line-height: 25px; margin-top: 20px; margin-bottom: 10px;\"><p style=\"margin-bottom: 10px;\">به طور کلی ۴ نوع سنگ قیمتی (الماس، زمرد، یاقوت کبود و یاقوت قرمز) داریم و تعداد زیادی سنگ های نیمه قیمتی مانند آمیتیس، سیترین، توپاژ و… که پیاده شدن این سنگ ها روی طلا آن را به جواهر تبدیل می کند. این که هنگام خرید جواهر چه سنگی را در اولویت قرار دهید یا تشخیص مرغوب بودن سنگ، دغدغه بسیاری از خریداران جواهر است؛ به طور کلی سنگ جواهر به ۳ دلیل ارزش پیدا می کند.</p><p style=\"margin-bottom: 10px;\">زیبایی و درخشندگی، کمیابی و با دوام بودن؛ سنگ برلیان که گونه ای از الماس است از نظر درخشش و دوام بالاتر از دیگر سنگ هاست و از آنجایی که مدیریت خوبی از ابتدای اکتشاف روی آن انجام شده بازار عرضه و تقاضای خوبی هم دارد اما سنگ های زمرد و یاقوت کبود کمیاب تر هستند و کیفیت بالای آن ها ارزش زیادی دارد و باعث گران بها شدن روزافزون آن ها می شود اما تشخیص مرغوب بودن تمامی سنگ ها از عهده افراد عادی خارج است .</p><p style=\"margin-bottom: 10px;\">برای مثال ممکن است شما انگشتر برلیانی بخرید که فروشنده مبلغ زیادی بابت سنگ کار شده روی آن بگیرد اما هنگام فروش متوجه شوید که برلیان به کار رفته در انگشتر به دلیل تراش بد و داشتن ناخالصی و… نامرغوب بوده و ارزش پول پرداختی شما را نداشته است. برای جلوگیری از این مشکل تنها راهی که می ماند این است که از جواهر فروشی هایی خرید کنید که معتبر باشند و جنس خریداری شده را تضمین کنند.</p><p style=\"margin-bottom: 10px;\">جواهر فروشی های معتبر هنگام فروش تنها ۱۵ تا ۲۰ درصد از پول پرداختی شما را کسر می کنند درصورتی که اگر فاکتور معتبری نداشته باشید هنگام فروش جواهر ممکن است ضرر زیادی متحمل شوید .</p></h3>', 1, 1, '2019-03-03 19:02:41', '2019-03-04 14:00:59'),
(7, 'images/news/2.jpg', 'قیمت بنزین در سال ۹۸ «فعلاً» ثابت خواهد ماند', 'افزایش قیمت بنزین برای سال ۹۸ ظاهراً با تکیه بر سخنان برخی نمایندگان مردم در مجلس شورای اسلامی از دستور کار خارج شده است.', '<p style=\"\">روز یکشنبه جمالی نوبندگانی&nbsp;عضو کمیسیون امنیت ملی مجلس با اشاره به مخالفت مجلس با چند نرخی شدن قیمت بنزین در پی بررسی لایحه بودجه سال ۹۸، گفت: باید پذیرفت قیمت بنزین در ایران نسبت به کشور‌های همسایه ارزان‌تر است و این ارزانی در داخل کشور افراد بسیاری را در مرز‌های غربی، شرقی و حتی جنوبی به قاچاق بنزین ترغیب می‌کند چراکه می‌توانند این محصول را در مرز‌ها تا هشت برابر قیمت به فروش برسانند.</p><p style=\"\">وی با تاکید بر اینکه مجلس در مخالف با افزایش و چند نرخی شدن قیمت بنزین میان وضعیت بد و بدتر، وضعیت بد را انتخاب کرد، تصریح کرد: در واقع باوجود آگاهی نسبت به عوارض تثبیت قیمت بنزین اما به دلیل بیداد کردن تحریم‌ها و تحمیل فشارهای اقتصادی بسیار ازسوی دشمن به کشور، چاره‌ای جز ثابت نگه داشتن قیمت بنزین نیست.</p><p style=\"\">جمالی نوبندگانی مدعی شده نمایندگان باوجود آگاهی نسبت به ضررهای این تثبیت قیمت، نخواستند فشارهای بیشتر اقتصادی به مردم وارد کنند، ادامه داد: اضافه شدن حتی یک ریال به قیمت بنزین، ده‌ها ریال تورم به بار می‌آورد.</p><p style=\"\">اما از سوی دیگر کاظم جلالی رئیس مرکز پژوهش‌ها درباره آخرین وضعیت تصمیم گیری برای بنزین گفت: هیچ اتفاقی برای بنزین در سال ۹۷ نخواهد افتاد.وی اضافه کرد: مجلس برای سال آینده هم درباره بنزین هیچ تصمیمی نگرفته و اگر قرار باشد تصمیمی هم گرفته شود باید دولت یا شورای عالی اقتصادی قوا ان را اتخاذ کنند.<br><br>جلالی در همین زمینه گفت: در برنامه ششم توسعه به دولت گفتیم باید قیمت بنزین و سوخت را به ۸۰ درصد فوب خلیج فارس برسانند لذا این مبنای قانونی برای تصمیم گیری دولت هست. «شورای هماهنگی قوا این اختیارات را دارند که در این خصوص تصمیم بگیرند و آن‌ها هم تصمیمی نگرفته اند لذا کسی نگرانی نداشته باشد»<br><br>وی در پایان تصریح کرد: در جمهوری اسلامی اینگونه تصمیمات لحظه‌ای نیست و حتما اگر قرار باشد تصمیمی گرفته شود مردم مطلع می‌شوند، البته ما در مرکز پژوهش‌ها پیشنهادمان را اعلام کردیم.</p><p style=\"\">منبع : پارسینه</p>', 2, 1, '2019-03-04 14:03:13', '2019-03-25 12:01:43'),
(8, 'images/news/1.jpg', 'بانک‌های نظامی در بانک سپه ادغام می‌شوند', 'این کار با هدف متمرکز کردن توامندی ها و ظرفیت بانک ها انجام می شود.', '<div dir=\"rtl\" style=\"\">بر اساس مصوبات شورای پول و اعتبار و شورای عالی هماهنگی اقتصادی (سران سه قوه) در ارتباط با ادغام بانک‌ها و موسسه اعتباری وابسته به نیرو‌های مسلح در بانک سپه، این مهم با اتخاذ تمهیدات مناسب و اطمینان بخش برای مشتریان، سپرده‌گذاران، سهامداران، کارکنان و سایر ذینفعان مد‌نظر قرار گرفته است و پس از انجام بررسی‌های کارشناسی گسترده با حضور نمایندگان دستگاه‌های ذی‌ربط، برنامه‌ای جامع، هماهنگ و مؤثر در مسیر اصلاح نظام بانکی کشور و ساماندهی بازار پول تدوین شده است.</div><div dir=\"rtl\" style=\"\"><br>بر این اساس، با هدف متمرکز کردن توانمندی و ظرفیت بانک‌های انصار، قوامین، حکمت ایرانیان، مهر اقتصاد و مؤسسه اعتباری کوثر در قالب یک بانک واحد با ثبات و کارآمدتر و به منظور ارائه خدمات بهتر به خانواده نیرو‌های مسلح و عموم مردم، بانک‌ها و مؤسسه اعتباری یادشده در بانک سپه به عنوان نخستین بانک ایرانی و یکی از بانک‌های معتبر دولتی در عرصه بانکداری کشورمان ادغام می‌شوند.<br><br>به منظور اطلاع‌رسانی شفاف به آحاد جامعه، بالاخص ذینفعان اصلی (سپرده‌گذاران، سهامداران و کارکنان)، موارد زیر را به استحضار مردم شریف ایران می‌رساند:<br><br>۱. ارایه خدمات بانکی به تمامی مشتریان محترم اعم از سپرده‌گذاران و تسهیلات‌گیرندگان توسط بانک‌ها و مؤسسه اعتباری یادشده، با مدیریت و راهبری بانک سپه طبق روال عادی قبلی به قوت خود ادامه دارد و مشتریان می‌توانند خدمات مزبور را همانند گذشته در چارچوب قرارداد‌های سپرده‌گذاری، تسهیلاتی و سایر قرارداد‌های منعقده قبلی دریافت کنند.<br><br>۲. به منظور حفظ و ایفای حقوق تمامی سهامداران بانک‌ها و مؤسسه اعتباری تحت ادغام و با عنایت به بررسی‌های کارشناسی همه جانبه و هماهنگی انجام گرفته با سازمان بورس و اوراق بهادار، چارچوب مدونی برای این مهم تنظیم شده و طبق برنامه، هر یک از بانک‌ها و مؤسسه اعتباری یادشده نسبت به تعیین تکلیف وضعیت سهامداران مرتبط با خود اقدام می‌کنند و به تمامی سهامداران اطمینان داده می‌شود کلیه حقوق آن‌ها کارسازی و ایفا خواهد شد.<br>۳. کلیه کارکنان شاغل در بانک‌ها و مؤسسه اعتباری موضوع این فرآیند همانند گذشته مشغول به فعالیت بوده و تمامی حقوق و مزایای آنان مطابق قرارداد‌های منعقده قبلی برقرار است.<br><br>۴. بی‌تردید در کنار لطف و مرحمت الهی، اصحاب رسانه، کارشناسان، مدیران و صاحب‌نظران نظام بانکی در راستای تشریک مساعی جهت دستیابی به اهداف مدنظر این تکلیف مهم، نقش انکارناپذیری داشته و مددکار مسئولان و عوامل این مأموریت عظیم هستند.<br><br>این فرآیند به عنوان گامی مهم در راستای حفظ ثبات و سلامت نظام بانکی محسوب می‌شودو همراهی در اجرای موفق آن برای ارائه خدمات بهتر به آحاد جامعه مورد انتظار است؛ بنابراین بانک مرکزی جمهوری اسلامی ایران از هموطنان گرامی تقاضا دارد اخبار و اطلاعات مربوط به این طرح ملی را صرفاً از طریق اطلاعیه‌های رسمی بانک مرکزی جمهوری اسلامی ایران یا بانک سپه پیگیری کنند.</div><div dir=\"rtl\" style=\"\">منبع : پارسینه</div>', 1, 1, '2019-03-04 14:06:15', '2019-03-25 12:01:53'),
(9, 'images/news/3.jpg', 'ملزومات رونق تولید؛ از برنامه صحیح تا مردِ عمل', 'راه اندازی \"چرخ تولید\" و ایجاد \"رونق تولید\" برنامه صحیح میخواهد و مردِ عمل', '<p style=\"margin-bottom: 18px;\">محمدرضا سبزعلیپور رئیس مرکز تجارت جهانی ایران طی یادداشتی به تحلیل نامگذاری سال 98 از سوی مقام معظم رهبری تحت عنوان سال \"رونق تولید\" پرداخت و با قلم خود نوشت: بطور قطع نامگذاری هر سال، مسئولین و دولتمردان را متوجه نیازهای روز کشور میکند. \"تولید داخلی\" یکی از اساسی ترین فاکتورها و روشهای مقابله با نفوذ و استعمار دشمنان و تحریم های اقتصادی و همچنین غلبه بر مشکلات اقتصادی ایران است که موجب تقویت \"اقتصاد ملی\" نیز میگردد.</p><p style=\"margin-bottom: 18px;\">نامگذاری سالها توسط مقام معظم رهبری، سُنت پسندیده و رسم نیکویی است که به شکل هدفمند از جانب \"امام خامنه ای\" جهت غلبه بر مشکلات اساسی ایران، رونق اقتصادی کشور و نهایتاً بهبود معیشت مردم و آسایش و آرامش ملت شریف ایران، پایه گذاری شده است. قطعاً کمتر مقام سیاسی را میتوان در جهان به عینه دید که چنین صریح و شفاف در مورد نیازهای کشور با مردمش سخن بگوید و اینچنین واضح و روشن، خط و خطوط و ابزار لازم برای تصمیم گیری در برابر مشکلات پیش رو را در اختیار دولت و مسئولین امر قرار دهد. با این اوصاف نامگذاری هر سال به صورت یک سنت حسنه، عموم مردم و مسئولین را متوجه نیازهای روز کشور برای دستیابی به افق های رشد و تعالی میکند.</p><p style=\"margin-bottom: 18px;\">لازم به تأکید است که امروزه در همه جوامع بشری، تولید از اهمیت خاصی برخوردار است و همه انسانها به نقش و اهمیت آن بخوبی واقفند. تولید برای مردم از اهمیت و ضرورت خاصی برخوردار است زیرا \"تولید\" بنوعی مساوی و در اصل به معنی زندگی، رشد، کار، تلاش، اشتغال، بهره گیری از طبیعت، رفع نیازهای زندگی و رفاه شخصی و عمومی، استفاده بهتر از منابع موجود و در کل مترادف با شکوفایی است و از همین رو، رفع مشکلاتی همچون رکود، بیکاری، تورم، مسکن و درکل به حرکت درآوردن چرخ عظیم اقتصاد یک جامعه در گرو به حرکت درآمدن \"تولید\" است.</p><p style=\"margin-bottom: 18px;\">تولید عامل اصلی ایجاد استحکام در اقتصاد و به سامان کردن اقتصاد و محورِ پیشرفت و توسعه کشور میباشد. ضرورت تولید داخلی و شکل گیری و سامان یافتن آن قطعاً تحولات بنیادینی در \"اقتصاد ملی\" و در نتیجه در \"معیشت مردم\" و بخصوص در حل مسایل و مشکلات اقتصادی زندگی ایجاد میکند.</p><p style=\"margin-bottom: 18px;\">افزایش \"تولید داخلی\" بمرور زمان به افزایش \"صادرات غیرنفتی\" کشور می انجامد و همین امر نیز بنوبه خود ضمن افزایش درآمدهای ارزی کشور، مجدداً به افزایش تولید منجر میشود.</p><p style=\"margin-bottom: 18px;\">گردش چرخ \"تولید\" سرمایه گذاری و مشکل جذب سرمایه های داخلی و خارجی را برطرف میکند. \"تولید\" همچنین سرمایه های سرگردان که گاهی بسیار مضر و در جهت نابودی اقتصاد عمل میکند را هم مدیریت می نماید. از امکانات و زیرساختهای موجود به نحو مطلوبتری استفاده میگردد. رشد علمی و صنعتی را نیز بدنبال خواهد داشت و هزینه های سنگین اقتصادی کشور را همچون هزینه های واردات، حمل و نقل و سایر وابستگی ها را کاهش میدهد.</p><p style=\"margin-bottom: 18px;\">گردش چرخ \"تولید\" دانش و تکنیک و فن آوریهای وابسته به تولید در عرصه های مختلف را رشد داده و بویژه مهارتهای مدیریت در امر تولید را بالا میبرد و با سایر کشورهای پیشرفته جهان، قابل رقابت میکند.</p><p style=\"margin-bottom: 18px;\">از همین رو \"تولید\" ، شاخص و معیار اصلی پیشرفت در یک کشور میباشد و برای ما نیز بعنوان شاخص پیشرفت، ملاکی برای اندازه گیری سرعت، شتاب و میزان پیشرفت محسوب میگردد.</p><p style=\"margin-bottom: 18px;\">موضوع تولید داخلی و تأکید بر آن علاوه بر همه اهمیتهای پیش گفته، ضرورتهای ویژه ای دارد که بخصوص در شرایط خاص و بحرانی کنونی برای کشورمان بسیار تعیین کننده و سرنوشت ساز میباشد.</p><p style=\"margin-bottom: 18px;\">در این ایام و در این مقطع از زمان که سوء مدیریتها و مشکلات اقتصادی از یکسو و جنگ اقتصادی آمریکا و تحریمهای بین المللی از سوی دیگر، کشور را تحت فشار قرار داده و روح مردم عزیزمان را آزار میدهد، رونق تولید و تأکید بر شتاب گرفتن چرخۀ \"تولید داخلی\" دارای معنا و مفهوم خاص و ویژه ای میباشد که تحقق \"رونق تولید\"&nbsp; و بقول معروف \"شعار سال\" فواید و دست آوردهای متعدد و چشمگیری را برای ایران و ایرانی در پی خواهد داشت که به تعدادی از این فواید، ذیلاً فهرست وار اشاره میکنم:</p><p style=\"margin-bottom: 18px;\">تحقق \"رونق تولید\" یعنی:</p><p style=\"margin-bottom: 18px;\">* افزایش درآمد ملی</p><p style=\"margin-bottom: 18px;\">* افزایش سرمایه گذاری</p><p style=\"margin-bottom: 18px;\">* افزایش صادرات غیرنفتی</p><p style=\"margin-bottom: 18px;\">* ایجاد اشتغال و مهار سریع بیکاری</p><p style=\"margin-bottom: 18px;\">* کاهش واردات</p><p style=\"margin-bottom: 18px;\">* کاهش قاچاق</p><p style=\"margin-bottom: 18px;\">* رشد اقتصادی</p><p style=\"margin-bottom: 18px;\">* تراز تجاری مثبت</p><p style=\"margin-bottom: 18px;\">* اقتدار اقتصادی</p><p style=\"margin-bottom: 18px;\">* رونق بخشیدن به حرکت کشور</p><p style=\"margin-bottom: 18px;\">* حرکت به سوی استقلال و خودکفائی و خوداتکائی و رهائی از وابستگی ها</p><p style=\"margin-bottom: 18px;\">* تحکیم پیشرفت همه جانبه</p><p style=\"margin-bottom: 18px;\">* تحقق اهداف عدالت و پیشرفت</p><p style=\"margin-bottom: 18px;\">* مستحکم کردن اقتصاد داخلی و شکوفا نمودن آن</p><p style=\"margin-bottom: 18px;\">* ساختن کشور و آباد کردن خانه خودمان</p><p style=\"margin-bottom: 18px;\">* رشد همه جانبه بدلیل نقش تولید در عرصه های فرهنگی، اجتماعی، سیاسی و اقتصادی</p><p style=\"margin-bottom: 18px;\">* بالا بردن درآمد و قدرت خرید مردم</p><p style=\"margin-bottom: 18px;\">* افزایش دارائیها و مالکیت مردم</p><p style=\"margin-bottom: 18px;\">* حذف دلالی ها و واسطه گری ها</p><p style=\"margin-bottom: 18px;\">* جذب سرمایه های بی هدف و سرگردان و سوق دادن آنها به سمت کار و تولید</p><p style=\"margin-bottom: 18px;\">* سامان دادن سرمایه ها در کشور</p><p style=\"margin-bottom: 18px;\">* ارتقاء بهره وری</p><p style=\"margin-bottom: 18px;\">* نفوذ وسیع و گسترده در دنیا و شناخته تر شدن در بین ملل جهان از طریق فروش و صادرات محصولات تولیدی</p><p style=\"margin-bottom: 18px;\">* رهائی از وابستگی به نفت و اقتصاد تک محصولی</p><p style=\"margin-bottom: 18px;\">* حرکت بسوی نوآوری، خلاقیت و پیدا کردن راهها و تکنیکهای جدید</p><p style=\"margin-bottom: 18px;\">از همه مهمتر اینکه \"رونق تولید\" برای کشورمان مساوی است با:</p><p style=\"margin-bottom: 18px;\">* ادامه جهاد اقتصادی</p><p style=\"margin-bottom: 18px;\">* همت مضاعف، کار مضاعف</p><p style=\"margin-bottom: 18px;\">* مبارزه با دشمنان</p><p style=\"margin-bottom: 18px;\">* مبارزه برای ایجاد استقلال</p><p style=\"margin-bottom: 18px;\">* دفاع از حریّت و کرامت ملت ایران</p><p style=\"margin-bottom: 18px;\">* پاسخ کوبنده به تهدیدات و تحریمهای دشمن</p><p style=\"margin-bottom: 18px;\">* خنثی سازی تحریمها و مقابله عملی و اجرایی با آن</p><p style=\"margin-bottom: 18px;\">* سیلی محکم به آمریکا و ترامپ</p><p style=\"margin-bottom: 18px;\">* عزت و سربلندی</p><p style=\"margin-bottom: 18px;\">* راه شهیدان و تثبیت نظام اسلامی در عرصه سیاسی و اقتصادی</p><p style=\"margin-bottom: 18px;\">* اجابت فرآمین رهبر خیرخواه و دوراندیش نظام</p><p style=\"margin-bottom: 18px;\">بسیار روشن است که پیشرفت کشور در گرو دو عنصر علم و تولید است. یک کشور برای دستیابی به اهداف خود نیازمند اولاً عنصر علم و دانش و ثانیاً عنصر تولید یعنی عمل و کار براساس دانش خود میباشد. از این رو اهمیت و ضرورت \"رونق تولید\" در این مرحله از عمر مبارک نظام اسلامی و در دهه عدالت و پیشرفت به روشنی آشکار و نمایان است.</p><p style=\"margin-bottom: 18px;\">\"رونق تولید\" و حمایت از تولید ملی راهکار و خط و خطوط مناسب و حیاتی است که دولت و مسئولین امر باید بدنبال تحقق آن باشند و این بدان معناست که گام برداشتن در راستای شعار سال 1398موجب میشود تا آمار بیکاری، فقر و... بسرعت کاهش یافته و امور اشتغالزایی خانواده ‌ها و بزرگتر شدن سفره مردم محقق شود.</p><p style=\"margin-bottom: 18px;\">لازم به ذکر است که رهبر معظم انقلاب با نامگذاری سال 98 تحت عنوان \"رونق تولید\" در اصل خط و خطوط را برای دولت، مسئولین امر و فعالان اقتصادی مشخص و تبیین نموده اند اما نکته مهم و بحث اساسی اینجاست که تحقق \"رونق تولید\" و گردش صحیح \"چرخ تولید\" در این کشور آنهم در این اوضاع حساس و تحریمی، اصلی و ابدا با حرف و سخنرانی محقق نخواهد شد بلکه رونق تولید نیازمند برنامه، سیاستگذاری صحیح، بسترسازی و فراهم آوردن امکانات و فاکتورهای لازم برای بازوان اجرایی کشور یعنی فعالان اقتصادی بخش خصوصی میباشد زیرا تولید فقط و فقط به دست توانمند صاحبان صنایع و صاحبان سرمایه در بخش خصوصی قابل تحقق میباشد و بجای اینکه دولت مزاحم و رقیب بخش خصوصی باشد ففقط و فقط باید سیاستگذار، بسترساز و حامی بخش خصوصی باشد و بس.</p><p style=\"margin-bottom: 18px;\">در حال حاضر هزاران کارخانه و واحد تولیدی کوچک، متوسط و بزرگ نیمه فعال و یا ورشکسته در سراسر ایران وجود دارند که در صورت ساماندهی و رسیگی به مشکلات آنها، قطعاً میتوانند بطور 100% وارد مدار تولید شوند و در همین زمان صدها کارخانه و واحد تولیدی و صنعتی در حال ساخت و یا نیمه کاره در اقصی نقاط این هستند که با کمی حمایت، میتوانند آنها را نیز به بهره برداری رساند و وارد خط تولید کرد و با این حرکت میتوان صدها هزار شغل ایجاد نمود و بازار را تا حدود زیادی به تحرک واداشت.!!</p><p style=\"margin-bottom: 18px;\">در عین حال راه اندازی \"چرخ تولید\" و ایجاد \"رونق تولید\" برنامه صحیح میخواهد و مردِ عمل و باید همه دولتمردان و همه امکانات دولتی و بخش خصوصی در این راه بسیج شوند و بطور شبانه روزی کار کنند تا این مهم تحقق یابد، کشور پیشرفت کند، مشکلات اقتصادی مرتفع گردد و فرآمین مقام معظم رهبری هم روی زمین نماند والا با حرف و سخنرانی و ادا و اطوار درآوردن و نمایش بازی کردن، چرخ تولید هرگز به گردش درنخواهد آمد!! اگر قرار باشد که مسئولین کشور بجای کار شبانه روزی، فقط تظاهر به کار بکنند و روزها و ماهها را با جلسه و دور هم نشینی و بازدید از کارخانه ها و صدور دستورات و بخشنامه ها و.... سپری کنند، قطعاً آب از آب تکان نخواهد خورد و در انتهای سال 98 نه تنها تولید کشور رونقی نخواهد گرفت بلکه تعداد دیگری از همین کارخانجات و واحدهای تولیدی فعال امروزی هم به جرگه ورشکسته ها خواهند پیوست!! پس رونق تولید همت بلند میخواهد مرد عمل!!</p><p style=\"margin-bottom: 18px;\">لازم به ذکر است که رهبر معظم انقلاب از سال 86 سنت حسنۀ نامگذاری سالها را پایه ریزی نمودند و تا امسال، 13 سال است که سالها نامگذاری شده و برای هر سال شعاری مهم انتخاب شده است اما نکته مهم و قابل تأمل این است که از 13 نامگذاری، تقریباً 11 مورد آن کاملاً اقتصادی بوده و اگر خط و خطوط مشخص شدۀ 12 سال گذشته از جانب مقام معظم رهبری توسط دولتهای نهم، دهم، یازدهم و دوازدهم با جدّیت و با دلسوزی پیگیری و از قوه به فعل تبدیل میشدند قطعاً امروز نه تنها اقتصاد مقاومتی بطور کامل محقق شده بود بلکه کشور ایران یکی از برجسته ترین و پیشرفته ترین اقتصادهای جهان را میداشت اما متأسفانه در 12 سال گذشته بقدری بی توجهی، تعلل و کم کاری از طرف دولتها صورت گرفته که همیشه در انتهای هر سال خبر ناخوشایندی شنیده ایم و آن این بوده که شعار امسال بطور کامل و یا اصلاً محقق نشد که این مایه خجالت و سرافکندگی است که آخر هر سال بجای شنیدن خبر خوشحال کننده و مسرت بخش، چنین گزارش مأیوس کننده ای تحویل مردم داده شود.!!</p><p style=\"margin-bottom: 18px;\">نامگذاری سالهای 1378 الى ١٣٩٨ توسط مقام معظم رهبری از \"اتحاد ملی\" تا \"رونق تولید\"<br>1378: سال امام خمینی قدس‌سره<br>1379: سال امام علی علیه‌السلام<br>1380: سال اقتدارملی و اشتغال‌آفرینی<br>1381: سال عزت و افتخار حسینی<br>1382: سال خدمت‌گزاری<br>1383: سال پاسخ‌گویی<br>1384: سال هم‌بستگی ملی و مشارکت عمومی<br>1385: سال پیامبر اعظم صلی الله علیه و آله</p><p style=\"margin-bottom: 18px;\">1386:&nbsp; اتحاد ملی، انسجام اسلامی</p><p style=\"margin-bottom: 18px;\">1387:&nbsp; نوآوری و شکوفایی</p><p style=\"margin-bottom: 18px;\">1388:&nbsp; حرکت به سمت اصلاح الگوی مصرف</p><p style=\"margin-bottom: 18px;\">1389:&nbsp; همت مضاعف، کار مضاعف</p><p style=\"margin-bottom: 18px;\">1390:&nbsp; جهاد اقتصادی</p><p style=\"margin-bottom: 18px;\">1391:&nbsp; تولید ملی و حمایت از کار و سرمایه ایرانی</p><p style=\"margin-bottom: 18px;\">1392:&nbsp; حماسه سیاسی و حماسه اقتصادی</p><p style=\"margin-bottom: 18px;\">1393:&nbsp; اقتصاد و فرهنگ، با عزم ملی و مدیریت جهادی</p><p style=\"margin-bottom: 18px;\">1394:&nbsp; دولت و ملت، همدلی و همزبانی</p><p style=\"margin-bottom: 18px;\">1395:&nbsp; اقتصاد مقاومتی؛ اقدام و عمل</p><p style=\"margin-bottom: 18px;\">1396:&nbsp; اقتصاد مقاومتی، تولید - اشتغال</p><p style=\"margin-bottom: 18px;\">1397:&nbsp; حمایت از کالای ایرانی</p><p style=\"margin-bottom: 18px;\">١٣٩٨ : رونق تولید</p><p style=\"margin-bottom: 18px;\">بطور مثال، مقام معظم رهبری سال 1391 را سال \"تولید ملی؛ حمایت از کار و سرمایه ایرانی\" نامگذاری کردند. ایشان در پیام نوروزی آن سال خود تصریح نمودند: اگر به توفیق الهی و با اراده و عزمِ راسخِ ملت و با تلاش مسئولان، ما بتوانیم مسئلۀ تولید داخلی را، آنچنان که شایستۀ آن است، رونق ببخشیم و پیش ببریم، بدون تردید بخش عمده ای از تلاشهای دشمن ناکام خواهد ماند. اما متأسفانه به هدفی که در آن سال به دنبالش بودیم نرسیدیم که اگر شعار \"تولید ملی\" سال 91 بطور کامل محقق شده بود، دیگر نیازی به شعار \"رونق تولید\" سال 98 نمی بود.</p><p style=\"margin-bottom: 18px;\">در نهایت امیدوارم دولت محترم جناب آقای روحانی \"رونق تولید\" را در سالجاری جدی بگیرد و تمام همّ و غم دولت خویش را جهت تحقق این شعار و اجرای فرمایش مقام معظم رهبری معطوف نماید تا از این گذر نه تنها بر مشکلات اقتصادی فائق آید بلکه دیگر شاهد این داستان غم انگیز و دردناک سالهای گذشته نباشیم که در پایان سال 98 هم گزارشی از عدم تحقق شعار \"رونق تولید\" به مردم داده شود.</p><p style=\"margin-bottom: 18px;\">منبع : خبرگزاری تسنیم</p>', 1, 1, '2019-03-25 12:04:56', '2019-03-25 12:04:56'),
(10, 'images/news/4.jpg', 'ارزش معاملات بورس در سال ۹۷ چقدر رشد داشت؟‌', 'ارزش معاملات بورس در سال ۹۷', '<p style=\"padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; text-size-adjust: 100%; outline: 0px;\">در سالی که گذشت تعداد بیش از ۵۲۰ میلیارد انواع اوراق بهادار به ارزش بیش از ۱۶۰ هزار میلیارد تومان در بیش از ۳۳ میلیون دفعه مورد معامله قرار گرفت که به ترتیب ۹۸، ۱۵۰ و ۱۱۶ درصد افزایش را نسبت به سال ۹۶ تجربه کرد.</p><p style=\"padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; text-size-adjust: 100%; outline: 0px;\">این درحالی است که تعداد ۵۸۸۸ میلیون واحد از صندوق های سرمایه گذاری قابل معامله در بورس تهران نیز به ارزش کل ۶۲۲۸۷ میلیارد ریال در سال ۹۷ مورد معامله قرار گرفت که به ترتیب با ۲۰۳ و ۲۱۱ درصد افزایش همراه شد.</p>', 1, 0, '2019-03-25 12:09:35', '2019-03-25 12:10:17'),
(11, 'images/news/4.jpg', 'ارزش معاملات بورس در سال ۹۷ چقدر رشد داشت؟‌', 'ارزش معاملات بورس در سال ۹۷', '<p style=\"padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; text-size-adjust: 100%; outline: 0px;\">در سالی که گذشت تعداد بیش از ۵۲۰ میلیارد انواع اوراق بهادار به ارزش بیش از ۱۶۰ هزار میلیارد تومان در بیش از ۳۳ میلیون دفعه مورد معامله قرار گرفت که به ترتیب ۹۸، ۱۵۰ و ۱۱۶ درصد افزایش را نسبت به سال ۹۶ تجربه کرد.</p><p style=\"padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; text-size-adjust: 100%; outline: 0px;\">این درحالی است که تعداد ۵۸۸۸ میلیون واحد از صندوق های سرمایه گذاری قابل معامله در بورس تهران نیز به ارزش کل ۶۲۲۸۷ میلیارد ریال در سال ۹۷ مورد معامله قرار گرفت که به ترتیب با ۲۰۳ و ۲۱۱ درصد افزایش همراه شد.</p><p style=\"padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; text-size-adjust: 100%; outline: 0px;\">منبع : مجله دوستان</p>', 1, 1, '2019-03-25 12:09:57', '2019-03-25 12:09:57'),
(12, 'images/news/5.jpg', 'طرح پیشنهادی سوئیس به واشنگتن برای تسهیل مبادلات کالاهای بشردوستانه با ایران', 'مقام‌های دولت آمریکا در حال بررسی طرح پیشنهادی سوئیس برای ایجاد یک کانال پرداخت جهت تسهیل مبادلات مربوط به فروش دارو، تجهیزات پزشکی و ... به ایران هستند.', '<p class=\"rtejustify\" style=\"overflow-wrap: break-word; margin-bottom: 15px !important;\">مقام‌های دولت «دونالد ترامپ»، رئیس‌جمهور آمریکا در حال بررسی طرح پیشنهادی سوئیس برای ایجاد یک کانال پرداخت جهت تسهیل مبادلات مربوط به فروش دارو، تجهیزات پزشکی و برخی اقلام دیگر به ایران هستند.&nbsp;</p><p class=\"rtejustify\" style=\"overflow-wrap: break-word; margin-bottom: 15px !important;\">شبکه خبری «ان‌بی‌سی‌نیوز» یکشنبه گزارش داده طرح سوئیس، راه‌اندازی یک کانال پرداخت برای ترغیب بانک‌های سوئیس جهت انجام تراکنش‌های مربوط به معاملات دارو، تجهیزات پزشکی و سایر اقلام بشردوستانه را شامل می‌شود.&nbsp;&nbsp;</p><p class=\"rtejustify\" style=\"overflow-wrap: break-word; margin-bottom: 15px !important;\">مبادلات کالاهای انسانی در حال حاضر نقض قوانین تحریم‌های آمریکا علیه ایران محسوب نمی‌شود، اما هشدارهای دولت آمریکا به شرکت‌های اروپایی در خصوص همکاری با بازار ایران موجب شده بانک‌های خارجی حتی از انجام تراکنش‌های مجاز برای مبادلات مربوط به ایران هم حذر کنند.</p><p class=\"rtejustify\" style=\"overflow-wrap: break-word; margin-bottom: 15px !important;\">منابع مطلع به ان‌بی‌سی‌نیوز گفته‌اند مقام‌های سوئیس به خزانه‌داری آمریکا پیشنهاد احیای مدلی را داده‌اند که در دولت قبلی آمریکا، قبل از حصول توافق هسته‌ای برجام، برای مبادله کالاهای انسانی با ایران به کار گرفته شد.</p><p class=\"rtejustify\" style=\"overflow-wrap: break-word; margin-bottom: 15px !important;\">مطابق این طرح، بانک‌های سوئیس، تراکنش‌های مربوط به معاملات میان شرکت‌های سوئیسی یا اروپایی برای فروش دارو، غذا و سایر اقلام انسانی به شرکت‌های ایرانی را بر عهده می‌گیرند.&nbsp;</p><p class=\"rtejustify\" style=\"overflow-wrap: break-word; margin-bottom: 15px !important;\">مقام‌های سوئیس به دنبال دریافت اطمینان بیشتر از وزارت خزانه‌داری و برطرف کردن نگرانی‌های بانک‌های سوئیسی برای تسهیل تراکنش‌های بانکی شرکت‌های اروپایی صادرکننده اقلام انسانی به ایران هستند.&nbsp;&nbsp;</p><p class=\"rtejustify\" style=\"overflow-wrap: break-word; margin-bottom: 15px !important;\">هنوز مشخص نیست که آیا دولت آمریکا به طرح سوئیس چراغ سبز نشان خواهد داد یا خیر. خزانه‌داری آمریکا از اظهارنظر درباره این گزارش خودداری کرده است.&nbsp;</p><p class=\"rtejustify\" style=\"overflow-wrap: break-word; margin-bottom: 15px !important;\">منبع : خبرگزاری فارس</p>', 1, 1, '2019-03-25 12:14:20', '2019-03-25 12:14:20'),
(13, 'images/news/7.jpg', 'در سال ۹۸ در کدام بازار سرمایه‌گذاری کنیم؟', 'اگر از کارشناسان اقتصادی درباره پیش‌بینی بازارهای مالی در سال ۹۸ بپرسید اکثریت آن‌ها سال ۹۸ را سال سختی برای اقتصاد کشور می‌دانند.', '<p style=\"margin-bottom: 1.5em; line-height: 1.5;\">وحید شقاقی شهری، کارشناس اقتصادی و استادیار دانشگاه علوم اقتصادی دانشگاه تهران در خصوص گزینه‌های پیش روی سرمایه‌گذاری در سال آینده گفته است: اگر از کارشناسان اقتصادی درباره پیش‌بینی بازارهای مالی در سال ۹۸ بپرسید اکثریت آن‌ها سال ۹۸ را سال سختی برای&nbsp;<a href=\"https://tejaratnews.com/%D8%A7%D9%82%D8%AA%D8%B5%D8%A7%D8%AF-%D8%A7%DB%8C%D8%B1%D8%A7%D9%86-%D8%AF%D8%B1-%D8%B3%D8%A7%D9%84-98\" style=\"border-bottom: 1px dotted;\">اقتصاد ایران</a>&nbsp;می‌دانند.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">وی تاکید کرده است: برای آنکه سرمایه شما علاوه بر حفظ ارزش، سودآور نیز باشد گزینه‌های ریسکی سرمایه‌گذاری را می توانید با درایت و تدبیر انتخاب کنید. در ادامه چند مورد از سرمایه گذاری‌های ریسکی را بررسی می‌کنیم.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">خرید ارز:&nbsp;به دلیل مشکلات در صادرات نفت امسال نرخ دلار در قانون بودجه سال ۹۸ لحاظ نشده است و همین موضوع بیانگر نوسانات زیاد این&nbsp;بازار&nbsp;است. دیدگاه‌های متناقض زیادی درباره آینده قیمتی&nbsp;بازار&nbsp;ارز وجود دارد، اما گروهی از فعالان ارزی اعتقاد دارند، زمانی که مشخص نیست&nbsp;<a href=\"https://tejaratnews.com/%D9%82%DB%8C%D9%85%D8%AA-%D8%AF%D9%84%D8%A7%D8%B1\" style=\"border-bottom: 1px dotted;\">قیمت دلار</a>&nbsp;به سوی سطوح بالاتر یا پایین‌تر حرکت خواهد کرد، خرید و فروش ارز ریسک زیادی به همراه دارد.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">خرید طلا:&nbsp;قیمت طلا متاثر از اتفاقات داخلی و بین‌المللی است. بنابراین اگر دولت سیاست‌های اقتصادی کارآمدی در پیش نگیرد و اثرات تحریم‌ها بر دلار همچنان ادامه داشته باشد، باید در انتظار افزایش قیمت طلا باشیم، هرچند متولیان حوزه طلا اعلام کرده‌اند پیش‌بینی قیمت دیگر امکان‌پذیر نیست و این موید ریسک بالای این روش سرمایه‌گذاری است.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">خرید مسکن:&nbsp;مسکن برای سرمایه گذاری با مبالغ بالا گزینه مناسبی است اما در نظر بگیرید که احتمال قرار گرفتن مسکن در رکودی دو ساله وجود دارد. حسام عقبایی نایب رئیس مشاوران املاک تهران در گزارشی از اقتصاد نیوز به تاریخ ۱۷ دی ماه می‌گوید: احتمال افزایش قیمت در شش ماه اول ۹۸ را نداریم، زیرا مسکن کشش افزایش قیمت را ندارد. سرمایه گذاری در شرایط رکودی کار عاقلانه‌ای به نظر نمی‌رسد.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">بورس:&nbsp;بر اساس گزارشی از روزنامه همشهری سال آینده سالی خواهد بود که وضعیت سودآوری سهام شرکت‌های بورس بهتر از امسال خواهد بود. در این گزارش آمده است، به مردم عزیز توصیه می‌کنیم از&nbsp;بازار&nbsp;دلار و سکه جدا شوند؛ زیرا این بازارها دیگر مطلوبیتی برای سرمایه گذاری ندارند و در انتهای روند افزایشی قرار دارند و بازار سهام در ابتدای یک روند صعودی قوی است. اما فراموش نکنید اگر تخصص لازم برای سرمایه‌گذاری در بازار بورس را ندارید از آن پرهیز کنید.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">سرمایه گذاری کم‌ریسک:&nbsp;اگر از جمله افرادی هستید که قدرت ریسک بالایی ندارید بانک‌ها، صندوق‌های سرمایه‌گذاری، اوراق مشارک و سایر اوراق با درآمد ثابت می‌توانند گزینه‌های خوبی برای سرمایه‌گذاری باشند. اما در نظر داشته باشید میزان سودی که از سرمایه‌گذاری به دست می‌آید با میزان ریسک رابطه مستقیم دارد. به هر حال، در سال ۹۸ این بازارها کما فی سابق کم‌ریسک و با سود مشخص هستند و فقط احتمال می‌رود سود حاصل از سرمایه‌گذاری در اوراقی مانند اخزا به ۲۸% تا ۲۹% برسد.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">منبع : تجارت نیوز</p>', 1, 1, '2019-03-26 07:03:24', '2019-03-26 07:03:24'),
(14, 'images/news/8.jpg', 'بخشنامه حقوق و دستمزد ۹۸', 'محمد شریعتمداری وزیر تعاون، کار و رفاه اجتماعی پس از مصوبه دویست و هشتاد و دومین نشست شورایعالی کار ، بخشنامه حداقل مزد سال ۱۳۹۸ رابه واحدهای مشمول قانون کار ابلاغ کرد.', '<p style=\"margin-bottom: 1.5em; line-height: 1.5;\">پس از مصوبه جلسه ۲۸۲ شورایعالی کار؛ شریعتمداری،&nbsp;بخشنامه مزد سال ۹۸&nbsp;را ابلاغ کرد.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">محمد شریعتمداری وزیر تعاون، کار و رفاه اجتماعی پس از مصوبه دویست و هشتاد و دومین نشست شورایعالی کار ، بخشنامه&nbsp;<a href=\"https://tejaratnews.com/%D8%AD%D8%AF%D8%A7%D9%82%D9%84-%D8%AD%D9%82%D9%88%D9%82-%D8%B3%D8%A7%D9%84-98\" style=\"border-bottom: 1px dotted;\">حداقل مزد سال ۱۳۹۸</a>&nbsp;رابه واحدهای مشمول قانون کار ابلاغ کرد.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">متن این بخشنامه به شرح زیر است :</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">شورایعالی کار با حضور نمایندگان سه گروه (دولت ،کارفرمایان و کارگران ) در جلسه مورخ ۱۳۹۷.۱۲.۲۷پس از بحث و بررسی راجع به تعیین حداقل مزد سال ۱۳۹۸، در اجرای ماده (۴۱) قانون کار با در نظر گرفتن مصالح کارگران در انطباق هر چه بیشتر میزان درآمد آنان با سطح معیشت و هم چنین با توجه به مقتضیات بنگاه های تولیدی وکارفرمایان و شرایط اقتصادی جامعه موارد زیر را به اجماع و اتفاق آرا مورد تصویب قرار داد.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">۱- از اول سال ۱۳۹۸<a href=\"https://tejaratnews.com/%D8%AD%D8%AF%D8%A7%D9%82%D9%84-%D8%AD%D9%82%D9%88%D9%82\" style=\"border-bottom: 1px dotted;\">حداقل حقوق و مزد</a>&nbsp;روزانه با نرخ یکسان برای کلیه کارگران مشمول قانون کار (اعم از قرارداد دائم یا موقت) مبلغ ۵۰۵۶۲۷ ریال (پانصد و پنج هزار و ششصد و بیست و هفت ریال) تعیین می گردد. همچنین از اول سال ۱۳۹۸ سایر سطوح مزدی نیز روزانه ۱۳ درصد مزد ثابت یا مزد مبنا (موضوع ماده ۳۶ قانون کار) به اضافه روزانه ۸۷۰۴۹ ریال به نسبت آخرین مزد در سال ۱۳۹۷ افزایش می یابد.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">تبصره: با اعمال افزایش این بند مزد شغل کارگران مشمول طرح های طبقه بندی مشاغل مصوب وزارت تعاون، کار و رفاه اجتماعی و نیز مزد ثابت سایر کارگران نباید از مبلغ ۵۰۵۶۲۷ ریال (پانصد و پنج هزار و ششصد و بیست و هفت ریال) بند (۱) کمتر شود.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">۲- به کارگرانی که در سال ۱۳۹۸ دارای یک سال سابقه کار شده یا یک سال از دریافت آخرین پایه سنواتی آنان گذشته باشد، روزانه مبلغ ۲۳۳۳۳ ریال نیز به عنوان پایه (سنوات) پرداخت خواهد شد.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">تبصره ۱: پرداخت مبلغ مربوط به پایه سنواتی کارگران مشمول طرح های طبقه بندی مشاغل مصوب وزارت تعاون، کار و رفاه اجتماعی با در نظر گرفتن رقم فوق الذکر برای گروه یک با توجه به دستورالعمل و جدول اعلامی توسط اداره کل روابط کار و جبران خدمت صورت می گیرد.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">تبصره۲ : به کارگران فصلی به نسبت مدت کارکردشان در سال ۱۳۹۷، میزان مقرر در این بند یا تبصره یک آن حسب مورد تعلق خواهد گرفت.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">تبصره۳ : بر اساس مصوبه مورخ ۱۳۹۷.۱۲.۲۷شورای عالی کار و در راستای تقویت مهارت محوری و بهره مندی تمامی کارگران و در نتیجه رضایتمندی کارگران با سابقه، از ابتدای سال ۱۳۹۸ همه کارگران دارای قرارداد دائم و موقت مشمول قانون کار که دارای یک سال سابقه کار شده و یا یک سال از دریافت آخرین پایه (سنوات) آنان در همان کارگاه گذشته باشد، اعم از اینکه حق سنوات یا مزایای پایان کار خود را تسویه حساب کرده باشند یا خیر، مشمول دریافت پایه (سنوات) خواهند بود.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">۳- بر اساس مصوبه مورخ ۱۳۸۷.۰۷.۲۱شورای عالی کار و در جهت افزایش رضایتمندی کارگران و کارفرمایان و به منظور تثبیت و تسری به تمامی کارگران، اعم از دائم و موقت مقرر شد از ابتدای سال ۱۳۹۸ کمک هزینه اقلام مصرفی خانوار به عنوان مزایای رفاهی و انگیزه ای موضوع تبصره ۳ ماده ۳۶ قانون کار بابت هر کارگر (اعم از متاهل یا مجرد) ماهانه مبلغ ۱۹۰۰۰۰۰ ریال از سوی کارفرمایان به آنان پرداخت گردد.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">۴- ضوابط مربوط به چگونگی نحوه اعمال افزایش مقرر در بند (۱) و تبصره یک بند (۲) در کارگاه هایی که دارای طرح طبقه بندی مشاغل می باشند و نیز در مورد کارگران کارمزدی و هم چنین چگونگی ارتقاء طبقه شغلی به موجب دستورالعمل های اداره کل روابط کار و جبران خدمت خواهد بود.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">۵- مقررات این مصوبه شامل حال دانش آموزان و دانشجویانی که در ایام تعطیلات تابستانی در سال ۱۳۹۸ به طور موقت در کارگاه ها اشتغال می یابند نخواهد شد.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">۶- واحدهای مشمول قانون کار به منظور ایجاد رابطه هر چه بیشتر مزد و مزایا با بهره وری و تولید و ایجاد انگیزه بیشتر در بین کارکنان خود، علاوه بر اجرای این مصوبه می توانند نسبت به افزایش و برقراری مزد و مزایا در قالب موافقت نامه های کارگاهی و پیمان های دسته جمعی و پس از تائید وزارت تعاون، کار و رفاه اجتماعی اقدام نمایند.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">منبع : تجارت نیوز</p>', 1, 1, '2019-03-26 18:14:01', '2019-03-26 18:14:01'),
(15, 'images/news/9.jpg', 'حمایت بانک مرکزی از سیل‌زدگان', 'رئیس کل بانک مرکزی بر حمایت سیستم بانکی کشور از هموطنان سیل زده در گلستان و مازندران تاکید کرد و گفت :', '<p style=\"margin-bottom: 1.5em; line-height: 1.5;\">عبدالناصر همتی، رئیس کل بانک مرکزی در یادداشتی اینستاگرامی با ابراز همدردی با هموطنان عزیز در استان گلستان و مازندران به خاطر سختی‌ها و صدمات وارده به اموال و فعالیت‌های اقتصادی آنها نوشت: عزیزانی که در آن مناطق فعالیت‌های دامداری، مرغداری، بافندگی، صنعت و تجارت و کشاورزی آنها آسیب دیده یا از بین رفته است، بدانند که قطعا سیستم بانکی کشور در زمینه های زیر با آنها همراهی کرده و مساعدت لازم خواهند کرد:</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">۱- اعطای وام‌های قرض الحسنه در کنار کمک‌های بلاعوض دولت</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">۲-به تأخیر انداختن اقساط بدهی‌های قبلی آنها و دادن تنفس چند ساله بدون اخذ جرائم و …</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">۳-اعطای وام‌های جدید برای راه اندازی مجدد فعالیت‌ها و نیز سرمایه درگردش مورد نیاز آنها برای ادامه تولید و فعالیت در واحدهایی که امکان ادامه فعالیت دارند.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">وی ادامه داد است: ان‌شاالله در هماهنگی با کارگروه هایی که در این زمینه تشکیل خواهد شد، همکاری و هماهنگی کامل برای کمک به عزیزان هموطن درآن منطقه خواهیم داشت.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">همتی تصریح کرده است: امیدوارم بیشتر فعالیت‌هایشان پوشش بیمه نیز داشته باشند و از طریق صنعت بیمه جبران خسارت بشوند.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">منبع : تجارت نیوز</p>', 2, 1, '2019-03-26 18:15:16', '2019-03-26 18:15:16'),
(16, 'images/news/10.jpg', 'حقوق مردم را بالا نبرید، چون تورم تشدید می‌شود!', 'برخی کارشناسان اقتصادی معتقدند اگر تورمی رخ دهد نباید دستمزد حداقلی کارگران را افزایش داد؛ چرا که به تورم مجدد منجر خواهد شد.', '<p dir=\"rtl\">ایران ما در ادوار گوناگون با تورمهای پرنوسان و شدید درگیر بوده است؛ نقاط اوج این تورمها را در چهار دوره می‌توان برشمرد: سالهای پیش از انقلاب (بیماری هلندی ناشی از افزایش شدید قیمت نفت)، بحران سال 74، بحران سال 91، و بحران سال 96، چهار زمانی هستند که تورم به عدم توازنهای اقتصادی در کشور انجامیده است؛ گرچه در زمانهای دیگر نیز اقتصاد ایران ثبات لازم در این زمینه را تجربه نکرده است.</p><p dir=\"rtl\"><img src=\"https://newsmedia.tasnimnews.com/Tasnim/Uploaded/Image/1398/01/08/13980108114110106170264910.jpg\" style=\"width: 744px; float: none;\"><br></p><p style=\"margin-bottom: 18px;\">مقایسه تورم ایران (کم‌رنگ) و جهان (پررنگ) طی 4 دهه گذشته (منبع: بانک جهانی)</p><p style=\"margin-bottom: 18px;\">اما یکی از مباحثی که همواره محل بحث بوده، میزان افزایش حداقل دستمزدها، به‌خصوص در سالهای تشدید تورم در کشور بوده است. در این زمینه یک پارادوکس مهم وجود دارد: اگر سطح دستمزدها، حداقل به اندازه تورم افزایش نیابد، در حق طبقه متوسط و ضعیف، اجحاف شده است؛ و اگر در آن سطح افزایش یابد، بر اساس \"نظریه مارپیچ قیمت-دستمزد\" به افزایش مجدد تورم منجر خواهد شد.</p><p style=\"margin-bottom: 18px;\">بیایید کمی روشن‌تر بحث کنیم.</p><p style=\"margin-bottom: 18px;\">\"نظریه مارپیچ قیمت-دستمزد\" (Wage-price Spiral) معتقد است افزایش سطح عمومی دستمزدها، دست‌کم از سه جهت می‌تواند موجب افزایش تورم شود:</p><ul style=\"text-align: start;\"><li style=\"\">اول اینکه افزایش دستمزدها، زمینه‌ای ایجاد می‌کند که تقاضاهای اجابت نشده عموم مردم، اجازه بروز یابند؛ خب، طبیعتاً افزایش تقاضا، با افزایش قیمت در بخش عرضه همراه خواهد بود.</li><li style=\"\">دوم اینکه افزایش دستمزد نیروی کار، به افزایش قیمت تمام‌شده کالاها در بنگاههای اقتصادی منجر می‌شود؛ متعاقب این، بنگاه تولیدی ناچار است کالای تولید شده را گرانتر عرضه کند.</li><li style=\"\">و سوم، در شرایطی - که شامل اقتصاد ایران هم می‌شود - کمبود منابع دولتی، موجب خواهد شد در پی افزایش دستمزدها، کسری بودجه (یعنی منفی بودن درآمد منهای هزینه) تشدید شود. کسری بودجه هم (در ایران) از کانالهای خاصی (به‌ویژه استقراض دولت از بانک مرکزی) فوراً به تورم خواهد انجامید.</li></ul><p style=\"margin-bottom: 18px;\">خب؛ بر همین اساس برخی صاحبنظران علوم اقتصادی همواره مخالف هستند که سطح عمومی دستمزدها به اندازه تورم افزایش پیدا کند. برای نمونه پرفسور هاشم پسران، استاد برجسته اقتصاد دانشگاه کمبریج معتقد است: «خطای اول این کشورها، بالابردن دستمزدها متناسب با نرخ تورم بوده است؛ این سیاست موجب افزایش نرخ تورم می‌شود.» (دنیای اقتصاد، شماره 3731) یا محمود باغجر، استاد دانشگاه شهید بهشتی، اخیراً اظهار کرده است که «واقعیت این است که هر چه دستمزدها بیشتر شود، قیمت تمام شده محصولات برای تولیدکنندگان هم بیشتر می‌شود و&nbsp;همین مسئله در نهایت باعث ایجاد تورم و افزایش قیمت محصولات هم خواهد شد.» (ایسنا 21 شهریور 97)</p><p style=\"margin-bottom: 18px;\">بطور کلی این موضوع در کتابهای متعدد «اقتصاد کلان» که در دانشگاههای ایران نیز تدریس می‌شود، درج شده است، که از آن می‌گذریم؛ نکته مهم اینکه صاحبنظران، در انتخاب دوراهیِ «تورم-رفاه قشر متوسط و ضعیف»، برای فرار از تبعات تورم بیشتر، همواره شرایط معیشتی مردم عادی را قربانی می‌کنند.</p><p style=\"margin-bottom: 18px;\">حال چه باید کرد؟</p><p style=\"margin-bottom: 18px;\">برای حل این مسئله باید کمی بالاتر برویم و مبنای مشکل را مورد بررسی قرار دهیم. گزاره مهمی که در ایران به بالا رفتن بی‌رویه قیمتها منجر می‌شود این است که «بخش نامولد اقتصاد، بدون کنترلهای لازم فعالیت می‌کند». این شرایط است که اقتصاددانان را به آن دوراهیِ بالا (دوراهیِ «تورم-رفاه قشر متوسط و ضعیف») می‌رساند. با ذکر چند مثال ببینیم این گزاره به چه معناست.</p><ul style=\"text-align: start;\"><li style=\"\">این گزاره یعنی اینکه فعالان اقتصادی - فقط با دور زدن عوامل بازدارنده فیزیکی - می‌توانند در سطح گسترده قاچاق کنند و به صنایع گوناگون داخلی ضربه بزنند؛ در کشورهایی که نظارت کافی بر حسابهای بانکی وجود دارد و منشأ هر تراکنش مالی مشخص است، قاچاق کالا به‌راحتی قابل کشف است.</li><li style=\"\">این گزاره یعنی «سلطان‌های سکه» می توانند بدون اینکه توسط سیستم بانکی شناسایی شوند و مالیات بدهند، بصورت کاملاً قانونی، هریک چند تُن! سکه بخرند و بازار را ملتهب کنند؛ و تنها «پس التهاب بازار» است که توسط سیستمهای امنیتی شناسایی شده و به اشد مجازات می‌رسند.</li><li style=\"\">و یعنی اینکه مردم، بصورت کاملاً قانونی، با هدف سفته بازی در صفهای طولانی دلار و سکه می‌ایستند و این عطش شدید سفته‌بازی، به افزایش سه برابری نرخها می‌انجامد و به تولید و به مردم ضربه می‌زند؛ بدون اینکه ریالی مالیات پرداخت شود.</li><li style=\"\">این گزاره یعنی بانکداران می‌توانند بدون اینکه مالیات بدهند، املاک تجاری خود را توسعه دهند؛ یا با سفته‌بازی و بورس‌بازی و ملتهب کردن بازارهای گوناگون، تنها با جابجایی پول، داراییهای خود را افزایش دهند.</li></ul><p style=\"margin-bottom: 18px;\">اساساً با وضع نظام مالیاتهای مربوط، افزایش تصاعدی قیمت و درآمد از راههای نامولد، به زیان فرد تمام خواهد شد. در کشورهای اروپایی، هیچ فردی نمی‌پذیرد که شما، با استفاده از حسابهای مالی او، پول جابه‌جا کنید؛ چرا که مطمئن است که نظام کنترلی مالی، منشأ پول را کنترل خواهد کرد، و اگر این منشأ با قوانین آن کشور مغایرت داشته باشد (مثل قاچاق)، تبعات سنگینی برای فرد به همراه خواهد داشت؛ و اگر هم اینچنین نباشد، حداقل مشکل، دریافت مالیات تصاعدی از این وجوهی است که به‌عنوان «درآمد» شناسایی خواهد شد!</p><p style=\"margin-bottom: 18px;\">اگر در کشور ما دو سه مورد کوچک - اما بنیادی - جدی گرفته شود، هیچ فعال اقتصادی نمی‌تواند بی‌حساب قیمتهایش را افزایش دهد:</p><ul style=\"text-align: start;\"><li dir=\"rtl\" style=\"\">شفافیت مالی</li></ul><p style=\"margin-bottom: 18px;\">شفافیت مالی کل فعالیتهای غیررسمی اقتصادی را به‌سرعت از بین خواهد برد؛ دزدی، اختلاس، ارتشا، قاچاق، و موارد دیگری که به پولشویی نیاز دارند از دور خارج می‌شوند. اگر مسئولان کشور به‌جای سیاسی کردن این موضوع و استفاده از اصطلاحاتی مانند «سرک کشیدن به حسابها»، تدبیر لازم در این زمینه اتخاذ کنند، شرایط اقتصاد کشور از بنیان دگرگون خواهد شد.</p><ul style=\"text-align: start;\"><li dir=\"rtl\" style=\"\">وضع پایه‌های مالیاتی مناسب</li></ul><p style=\"margin-bottom: 18px;\">اساساً در ایران «مالیات بر افزایش دارایی» نداریم. برای مثال در کشورهای غربی اگر شما خانه‌ای به 100 دلار بخرید و به 300 دلار بفروشید، باید رقمی - تا 60 درصد - از این افزایش 200 دلاری را مالیات بپردازید. این شرایط باعث شده، بازار سفته‌بازی جذابیتش را بکل از دست بدهد.</p><ul style=\"text-align: start;\"><li dir=\"rtl\" style=\"\">اتخاذ یک بسته سیاستهای راهبردی مهم و توأمان: «سیاستهای انقباضی بخش غیرمولد و سیاستهای انبساطی برای تولید»</li></ul><p style=\"margin-bottom: 18px;\">حتی اگر برخی از فعالیتهای غیرمولد (مانند دلالی یا تجارت)، از کمند قواعد بالا فرار کنند، قوانین و فضای کسب و کار کشورهای صنعتی بگونه‌ای تعبیه شده که فعال اقتصادی به تولید تمایل بیشتری دارد تا فعالیت نامولد.</p><p style=\"margin-bottom: 18px;\">با توجه به ظرفیتهای اقتصادی کشور ایران به نظر می‌رسد هیچیک از راهکارهای بالا، «نشدنی» نباشد؛ آنچه مانع است، ضعف تدبیر در سیاستگذاران و دست‌اندرکاران راهبردی اقتصاد ایران است. اتخاذ این راهبردها، شرایطی را فراهم می‌آورد که دعوای دائمی، اما بی‌اصالت و حیدری-نعمتی درباره تأثیر نرخ دستمزدها بر تورم، به محاق برود و تقریباً «سالب&nbsp;به انتفاء موضوع» باشد.</p><p style=\"margin-bottom: 18px;\">منبع : خبرگزاری تسنیم</p>', 1, 1, '2019-03-28 15:53:33', '2019-03-28 15:53:33');
