(17, 'images/news/11.jpg', 'قیمت منطقی دلار ۵ هزار تومان است', 'عضو هیات رئیسه کمیسیون اقتصادی مجلس با بیان اینکه قیمت منطقی دلار در ایران پنج هزار تومان است.', '<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"FA\" style=\"\">هفت ماه پیش (۱۴مرداد ماه ۹۷) رئیس کل بانک مرکزی در گفتگوی تلویزیونی\r\nبا اطمینان خاطر از بازار ارز سخن گفت، اما در فردای آن روز نرخ دلار در بازار\r\nآزاد از ۹۵۰۰ به ۹۷۳۰ تومان افزایش پیدا کرد</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"FA\" style=\"\">همچنین ( ۲۲ بهمن ماه ۹۷) هم رئیس کل بانک مرکزی اعلام کرد که نرخ\r\nفعلی به هیچ وجه قیمت ذاتی دلار نیست و برای تعدیل آن برنامه داریم و مطمئن باشید\r\nتمام تلاش خود را مصروف تقویت ارزش پول ملی خواهیم کرد، اما برخلاف اظهار نظر رئیس\r\nکل بانک مرکزی از ابتدای اسفندماه نرخ دلار در بازار افزایش پیدا کرد و از مرز ۱۳\r\nهزار تومان هم گذشت</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"FA\" style=\"\">شنبه شب ( ۱۱ اسفند ماه ۹۷) عبدالناصر همتی در گفتگوی ویژه تلویزیونی\r\nاعلام کرد که&nbsp;قیمت دلار</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span lang=\"FA\" dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span> </span><span lang=\"FA\" style=\"\">به کانال\r\n۱۱ هزار تومان بازمی‌گردد، اما هنوز این وعده محقق نشده است. آیا می‌توان همچنان\r\nبه صحبت‌های رئیس کل بانک مرکزی درخصوص اینکه دلار ارزان می‌شود خوشبین بود؟</span><span dir=\"LTR\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"FA\" style=\"\">معصومه آقاپور علیشاهی، عضو هیات رئیسه کمیسیون اقتصادی مجلس شورای\r\nاسلامی در گفتگو با «تجارت‌نیوز» گفت: اگر افزایش حجم نقدینگی در کشور کنترل شود،\r\nقیمت دلار مطابق گفته رئیس کل بانک مرکزی به رقم ۱۱ هزار تومان در سال ۹۸ بازمی‌گردد،\r\nاما اگر افزایش حجم نقدینگی در کشور کنترل نشود قیمت دلار در سال ۹۸ شتاب‌زده\r\nافزایش پیدا خواهد کرد</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"FA\" style=\"\">نماینده مردم شبستر در مجلس شورای اسلامی در پاسخ به این سوال که آیا\r\nارزش ذاتی دلار را رقم ۱۱ هزار تومان می‌دانید؟ تصریح کرد: معتقدم&nbsp;قیمت منطقی\r\nدلار</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>&nbsp;</span><span lang=\"FA\" style=\"\">در ایران پنج هزار\r\nتومان است</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></p>\r\n\r\n<blockquote><span lang=\"FA\" style=\"\">معتقدم نرخ بیکاری به دلیل افزایش حداقل حقوق و دستمزد کارگران برای\r\nسال آینده افزایش پیدا می‌کند، زیرا بخش خصوصی نمی‌تواند این میزان افزایش حداقل\r\nحقوق و دستمزد کارگران را تحمل کند</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></blockquote>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"FA\" style=\"\">نماینده مردم شبستر در مجلس شورای اسلامی در پاسخ به این سوال که آیا&nbsp;افزایش\r\nحداقل حقوق</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>&nbsp;</span><span lang=\"FA\" style=\"\">و دستمزد کارگران\r\nبرای سال ۹۸ باعث افزایش نرخ تورم و نرخ بیکاری می‌شود؟ تصریح کرد: معتقدمنرخ\r\nبیکاری&nbsp;به دلیل افزایش حداقل حقوق و دستمزد کارگران برای سال ۹۸ افرایش پیدا\r\nمی‌کند، زیرا بخش خصوصی نمی‌تواند این میزان&nbsp;افزایش حداقل حقوق</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>&nbsp;</span><span lang=\"FA\" style=\"\">و دستمزد کارگران را تحمل کند</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"FA\" style=\"\">این نماینده مردم در مجلس دهم افزود: به منظور عدم افزایش&nbsp;نرخ\r\nبیکاری&nbsp;در سال ۹۸ ضرورت دارد که یارانه به بخش تولید پرداخت شود</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></p>\r\n\r\n<blockquote><span lang=\"FA\" style=\"\">حجم نقدینگی که رو به افزایش باشد و تناسبی با رشد اقتصادی کشور نیز\r\nنداشته باشد، این حجم نقدینگی باعث ایجاد فضای سفته‌بازی می‌شود و به هر کدام از\r\nبازارهای موازی که هدایت شود همانند بهمنی است که آن بازار را تخریب می‌کند</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></blockquote>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"FA\" style=\"\">نماینده مردم شبستر در مجلس شورای اسلامی در پاسخ به این سوال که&nbsp;مهمترین\r\nبحران اقتصادی ایران در سال ۹۸</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>&nbsp;</span><span lang=\"FA\" style=\"\">چیست؟ گفت: کنترل حجم\r\nنقدینگی می‌تواند مهمترین بحران اقتصادی ایران در سال ۹۸ باشد</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"FA\" style=\"\">این نماینده مردم در مجلس دهم افزود: حجم نقدینگی که رو به افزایش\r\nباشد و تناسبی با رشد اقتصادی کشور نیز نداشته باشد،</span><span lang=\"FA\">این حجم نقدینگی باعث ایجاد\r\nفضای سفته بازی می‌شود و به هر کدام از بازارهای موازی که هدایت شود همانند بهمنی\r\nاست که آن بازار را تخریب می‌کند، بنابراین حجم نقدینگی مهمترین شاخص کلان اقتصادی\r\nاست که کنترل آن در سال آینده بسیار ضرورت دارد</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.</span></p>\r\n\r\n<blockquote><span lang=\"FA\" style=\"\">درخصوص توزیع کالابرگ الکترونیکی بیشتر تاکید دارم، زیرا حجم نقدینگی\r\nبه سمت خرید کالاها هدایت می‌شود و شخص با توجه به تقاضای خود خرید برای سفره خود\r\nانجام می‌دهد</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<br><o:p></o:p></span><span lang=\"FA\" style=\"\">نماینده مردم شبستر در مجلس شورای اسلامی در پاسخ به این سوال که آیا&nbsp;قیمت\r\nکالاهای اساسی در سال ۹۸ گران‌تر می‌شود؟ تصریح کرد: قاعدتا قیمت کالاهای اساسی در\r\nسال ۹۸ افزایش پیدا خواهد کرد</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></blockquote>\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span lang=\"FA\" style=\"\">نایب رئیس کمیسیون اقتصادی مجلس در پاسخ به این سوال که چقدر تخصیص\r\nکالا برگ الکترونیکی به منظور کاهش قیمت کالاهای اساسی د‌هک‌های کم درآمد جامعه و\r\nکاهش شکاف طبقاتی میان دهک‌های درآمدی ضرورت دارد؟ گفت: درخصوص توزیع کالابرگ\r\nالکترونیکی بیشتر تاکید دارم، زیرا حجم نقدینگی به سمت خرید کالاها هدایت می‌شود و\r\nشخص با توجه به تقاضای خود خرید برای سفره خود انجام می‌دهد</span><span dir=\"LTR\"></span><span dir=\"LTR\"></span><span dir=\"LTR\"><span dir=\"LTR\"></span><span dir=\"LTR\"></span>.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\"><span dir=\"LTR\"><o:p>&nbsp;</o:p></span></p>', 1, 1, '2019-03-28 16:01:45', '2019-03-28 16:01:45'),
(18, 'images/news/12.jpg', 'طلا بدترین عملکرد خود در ۸ ماه اخیر را ثبت کرد', 'قیمت طلا در معاملات روز جمعه بازار جهانی با رشد دلار و بازارهای سهام، کاهش یافت و این فلز ارزشمند به سوی ثبت بدترین عملکرد ماهانه از ماه آگوست سال ۲۰۱۸ تاکنون در حرکت است.', '<p style=\"margin-bottom: 1.5em; line-height: 1.5;\">هر اونس&nbsp;طلا&nbsp;برای تحویل فوری در معاملات روز جاری بازار سنگاپور، حدود ۰.۱ درصد افت کرد و به ۱۲۸۸.۷۴ دلار رسید. بهای معاملات این بازار روز گذشته حدود ۱.۵ درصد سقوط کرده بود که بزرگترین کاهش یک روزه در بیش از هفت ماه اخیر بود.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">طلا در مسیر ثبت نخستین کاهش هفتگی در چهار هفته گذشته قرار دارد و در ماه میلادی جاری حدود ۱.۸ درصد کاهش قیمت داشته است. اما بر مبنای سه ماهه، طلا در مسیر ثبت دومین رشد قیمت سه ماهه قرار دارد که ناشی از موضع بانک مرکزی آمریکا برای توقف افزایش نرخ‌های بهره و نگرانی‌ها پیرامون رشد اقتصاد جهانی است.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">در بازار معاملات آتی آمریکا، هر اونس طلا با ۰.۱ درصد کاهش، به ۱۲۸۸ دلار رسید. دلار در مسیر ثبت بهترین عملکرد ماهانه خود در پنج ماه اخیر قرار دارد، در حالی که بازارهای آسیایی با امید به پیشرفت مذاکرات آمریکا و چین، صعود کرده‌اند.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">دو اقتصاد بزرگ جهان دور جدید مذاکراتشان را روز پنج‌شنبه آغاز کردند که به جنگ تجاری پایان دهند.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">بر اساس گزارش رویترز، گری کودلاو، مشاور اقتصادی کاخ سفید اظهار کرده است که آمریکا ممکن است برخی از تعرفه‌ها روی کالاهای چینی را حذف کند و برخی دیگر را در راستای مکانیزم اجرایی توافق تجاری، حفظ کند.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">در این بین، هر اونس پالادیم برای تحویل فوری ۱.۱ درصد افزایش یافت و به ۱۳۶۳ دلار رسید. این فلز روز گذشته به پایین‌ترین قیمت در دو ماه گذشته سقوط کرده بود. پالادیم که در ساخت کاتالیزورهای کاهش آلودگی خودرو به کار می‌رود، روز پنج‌شنبه ۶.۶ درصد سقوط کرد که بزرگترین کاهش قیمت این فلز از ژانویه سال ۲۰۱۷ بود. هر اونس نقره برای تحویل فوری ثابت بود و در ۱۵.۰۱ دلار ایستاد. هر اونس پلاتین برای تحویل فوری حدود یک درصد افزایش یافت و به ۸۴۴.۷۵ دلار رسید.</p><p style=\"margin-bottom: 1.5em; line-height: 1.5;\">منبع : تجارت نیوز</p>', 2, 1, '2019-03-30 10:13:30', '2019-03-30 10:13:30'),
(19, 'images/news/13.jpg', 'قاضی آمریکایی بانک‌های اروپایی را در پرونده ایران تبرئه کرد', 'قاضی دادگاهی در آمریکا مدارک ارائه شده از سوی نظامیان آمریکایی مجروح شده در عراق که ۹ بانک اروپایی را به ارائه خدمات مالی به ایران متهم کرده بودند، ناکافی دانست و پرونده را مختومه اعلام کرد.', '<p dir=\"rtl\">به گزارش رویترز، گروهی از نظامیان آمریکایی مجروح شده در عراق ، شکایتی را علیه 9 بانک اروپایی در دادگاهی در منهتن نیویورک مطرح کرده بودند.<br style=\"\">&nbsp;شاکیان مدعی بودند که این 9 بانک اروپایی در حملاتی که بین سال های 2003 تا 2011 میلادی از سوی برخی گروهها با حمایت ایران علیه آنان انجام شده بود ؛ خدمات مالی به تهران داده بودند .<br style=\"\">برغم ادعاهای مطرح شده از سوی شاکیان ؛ «لورا تیلور سواین » قاضی این دادگاه حکم داد که ارتباط خدمات این بانک ها با حملات مورد اشاره بسیار دورتر از آن است که بتوان آن ها را تحت قوانین مبارزه با تروریسم آمریکا محاکمه کرد.<br style=\"\">سواین همچنین بانک های اروپایی را از اتهام آگاهی از ارتباط این خدمات مالی با حملاتی که در عراق انجام شده، تبرئه کرد.<br style=\"\">این قاضی گفت شواهدی وجود ندارد که ثابت کند خدمات مالی این بانک ها نقش مهمی در این حملات داشته است .</p><p dir=\"rtl\"><br></p><p dir=\"rtl\">منبع :&nbsp;tala.ir</p>', 2, 1, '2019-03-30 10:15:19', '2019-03-30 10:15:19'),
(20, 'images/news/14.jpg', 'پیشنهاد جدید همتی برای هدایت نقدینگی به‌سمت تولید', 'رئیس‌کل بانک مرکزی برای هدایت نقدینگی به‌سمت تولید پیشنهاد جدیدی مطرح کرد.', '<p style=\"margin-bottom: 18px;\">عبدالناصر همتی رئیس کل بانک مرکزی یادداشت اینستاگرامی جدیدی در خصوص هدایت نقدینگی به‌سمت تولید در سال رونق تولید به‌شرح زیر منتشر کرد؛</p><p style=\"margin-bottom: 18px;\">در بحث هدایت نقدینگی دو نکته مهم وجود دارد؛ نکته اول مفهوم نقدینگی است:&nbsp;</p><p style=\"margin-bottom: 18px;\">🔻بخش عمده‌ای از حجم نقدینگی هم‌اکنون تبدیل به تسهیلات، اعم از تولیدی یا غیر آن شده و یا توسط خود بانک‌ها، تبدیل به انواع دیگری از دارایی شده است که بخش عمده آنها، هم‌راستا با تأمین هدف بهینه اجتماعی نبوده و اصلاح آنها ضرورت دارد.</p><p style=\"margin-bottom: 18px;\">🔻نکته دوم اینکه: نقدینگی در بخش‌هایی متمرکز می‌شود که بیشترین بازدهی (خالص از ریسک) را داشته باشد، لذا، برای هدایت نقدینگی به‌سمت تولید، باید بازدهی بخش تولید، از طریق بهبود فضای کسب‌وکار، کاهش هزینه‌های تولید، بالا رفتن قدرت خرید مردم برای تقاضا و رشد صادرات، افزایش یابد تا انگیزه لازم برای سرمایه گذاری منتج به رونق تولید، ایجاد بشود.</p><p style=\"margin-bottom: 18px;\">🔻 با توجه به ریشه شوک تورمی اخیر، بانک مرکزی درکنار سیاست مرتبط با&nbsp;نرخ ارز، سیاست پولی مناسب در شرایط فعلی را تغییر ترکیب کمیت‌های پولی برای پرهیز از رکود و حرکت به‌سمت رونق تولید می‌داند، تا با افزایش عرضه از فشار تورمی کاسته شود.</p><p style=\"margin-bottom: 18px;\">منبع : تسنیم</p><p style=\"margin-bottom: 18px; color: rgb(64, 64, 64); font-family: Nassim; font-size: 18px;\"></p>', 2, 1, '2019-03-30 10:18:09', '2019-03-30 10:18:20');
